description:
स्थानीय बजारमा आज पनि सुनचाँदीको मूल्यले कीर्तिमान कायम गरेको छ ।&amp;nbsp;

नेपाल सुनचाँदी व्यवसायी महासंघका अनुसार आज एक तोला छापावाल सुनको मूल्य तीन लाख ३९ हजार ३०० र त्यति नै चाँदीको मूल्य सात हजार ५०५ कायम भएको छ ।

बुधबार एक तोला छापावाल सुनको

पृथ्वीराजमार्ग अन्तर्गत तनहुँको म्याग्दे गाउँपालिका&amp;ndash;१ गुणादीमा बिहीबार बिहान स्कुटर दुर्घटना हुँदा एक जनाको मृत्यु भएको छ ।&amp;nbsp;

दुर्घटनामा एक जना घाइते भएको जिल्ला प्रहरी कार्यालयले जनाएको छ ।&amp;nbsp;

प्रहरी नायब उपरीक्षक श्रवणकुम

यही माघ ११ गते सम्पन्न राष्ट्रियसभा निर्वाचनमा ९३ वटा मत बदर भएको पाइएको छ ।

निर्वाचन आयोगले राष्ट्रपति रामचन्द्र पौडेललाई बुझाएको निर्वाचन परिणामसहितको प्रतिवेदनमा ९३ वटा मत बदर भएको उल्लेख छ ।&amp;nbsp;

खसेको कूल १९२४ मतमध्ये १८३१ (९५.१७ प्रतिशत)

सुदूरपश्चिम भ्रमणमा रहेका राष्ट्रिय स्वतन्त्र पार्टीका वरिष्ठ नेता बालेन (बालेन्द्र शाह) बझाङ पुगेका छन् ।&amp;nbsp;

उनले बझाङमा रास्वपाका उम्मेदवार शैलेशकुमार सिंहसँग भेटघाट गरेका छन् । बझाङमा बिहानै पनि उनको क्रेज देखिएको छ ।&amp;nbsp;

